import {
    IonButton,
    IonInput,
    IonItem,
    IonLabel,
    IonCardContent,
    IonCard,
    IonCardHeader,
    IonCardTitle,
    IonToolbar,
    IonTitle,
    IonContent,
} from "@ionic/react";
import React, { useState, useEffect } from 'react';
import Table from '@mui/material/Table';
import TableBody from '@mui/material/TableBody';
import TableCell from '@mui/material/TableCell';
import TableContainer from '@mui/material/TableContainer';
import TableHead from '@mui/material/TableHead';
import TableRow from '@mui/material/TableRow';
import Paper from '@mui/material/Paper';
import TablePagination from '@mui/material/TablePagination';
import baseUrl, { api } from '../../pages/Urls';
import { Link, Route } from 'react-router-dom';
import { useHistory } from "react-router";
import TopicFrom from "./TopicFrom";
import { TableFooter } from "@mui/material";

const QuizAttemptedList: React.FC<{

    courseId: string

}> = (props) => {


    const [page, setPage] = React.useState(0);
    const [rowsPerPage, setRowsPerPage] = React.useState(10);
    const [search, setSearch] = useState('');
    const [attemptList, setAttemptList] = useState([]);
    const history = useHistory();
    const handleChangePage = (event: any, newPage: any) => {
        setPage(newPage);
    };

    const handleChangeRowsPerPage = (event: any) => {
        setRowsPerPage(+event.target.value);
        setPage(0);
    };

    useEffect(() => {
        fetch(`${baseUrl}${api.attemptHistory}${props.courseId}`, {
            method: 'GET',
            headers: {
                Accept: 'application/json',
                'Content-Type': 'application/json',
                'Authorization': `Bearer ${localStorage.getItem("token")}`

            }
        })
            .then(resp => resp.json())
            .then(result => {
                setAttemptList(result)

            })

    }, []);
    const reAttempt = (id: any) => {
        if (window.confirm('Are you sure?')) {
            let data = {
                'is_attempt': 0,
            }
            fetch(`${baseUrl}${api.reAttempt}${id}`, {
                method: 'PUT',
                headers: {
                    Accept: 'application/json',
                    'Content-Type': 'application/json',
                    'Authorization': `Bearer ${localStorage.getItem("token")}`

                },
                body: JSON.stringify(data),

            }).then(res => {
                if (res.status === 200) {

                    window.location.href = `/dashboard/mycourse/${props.courseId}/attempt/list`;
                }

            })
                .catch(error => console.log('error', error));

        }
    }

    return (

        <>
            <div className="container mt-5">

                <Paper sx={{ width: '100%', mb: 2 }}>
                    <p className="h1 text-center">Quiz Attempted User List</p>
                    <div className="input-group rounded mt-3 mb-2">
                        <input type="search" className="form-control rounded mx-2" placeholder="Search" onChange={(e: any) => setSearch(e.target.value)} />

                    </div>


                    <TableContainer>

                        <Table aria-label="simple table">
                            <TableHead>
                                <TableRow>
                                    <TableCell>No</TableCell>
                                    <TableCell >Quiz Name</TableCell>
                                    <TableCell >User Name</TableCell>
                                    <TableCell >Total Mark</TableCell>
                                    <TableCell >Action</TableCell>

                                </TableRow>
                            </TableHead>

                            {attemptList.length > 0 ?
                                <TableBody>
                                    {(rowsPerPage > 0
                                        ? attemptList.slice(page * rowsPerPage, page * rowsPerPage + rowsPerPage)
                                        : attemptList
                                    ).filter((item: any) => {
                                        return search.toLowerCase() === '' ? item :
                                            item.name.toLowerCase().includes(search);

                                    }).map((item: any, i: any) => (
                                        <TableRow key={i.toString()}>


                                            <TableCell component="th" scope="row">{i + 1}</TableCell>
                                            <TableCell >{item.quiz_name} </TableCell>
                                            <TableCell >{item.name} </TableCell>
                                            <TableCell >{item.total_point} / {item.total_question}</TableCell>

                                            <TableCell >

                                                <button onClick={() => reAttempt(item.id)} >
                                                    <i className="bi bi-code-square" title="re-attempt"></i>
                                                </button>


                                            </TableCell>


                                        </TableRow>
                                    ))}


                                </TableBody>
                                :
                                <div className="text-center mt-3" color="red">
                                    No data preview
                                </div>

                            }
                        </Table>

                    </TableContainer>
                    <TablePagination
                        rowsPerPageOptions={[5, 10, 20]}
                        component="div"
                        count={attemptList.length}
                        rowsPerPage={rowsPerPage}
                        page={page}
                        onPageChange={handleChangePage}
                        onRowsPerPageChange={handleChangeRowsPerPage}
                    />
                </Paper>

            </div>
        </>


    )
}
export default QuizAttemptedList;
